import React, { Component } from 'react';

class  RankingContentsIdentifire extends Component {
    
    constructor(props){
        super(props)
        this.state={

        }
    }
    
    render() { 
        const {contents} =  this.props;
        if (!contents.data) return <div> {contents.title} </div>;
        console.log( "Genereated Contents : ", contents.data)
        contents.data.map((data, i)=>{
            console.log(data);
        });
        return (
            <div> 
                Ranking Contetns will be placed here
            </div>
        );
    }
}
 
export default RankingContentsIdentifire;
